const DEFAULT_TASKS = [
  {
    name: "Go to gym",
    priority: 3,
    status: 3,
    key: Math.random(),
  },
  {
    name: "Read a book",
    priority: 1,
    status: 1,
    key: Math.random(),
  },
  {
    name: "Go to market",
    priority: 2,
    status: "In Progress",
    key: Math.random(),
  },
  {
    name: "Restart Learning Solidworks",
    priority: 3,
    status: 3,
    key: Math.random(),
  },
  {
    name: "change slider to scroll",
    priority: 3,
    status: "Done",
    key: Math.random(),
  },
  {
    name: "To publish the article",
    priority: 2,
    status: "In progress",
    key: Math.random(),
  },
];

export default DEFAULT_TASKS;
